import React from "react";
import $ from 'jquery';
import "../css/Home.css";
import logo from "../img/logo.png";

function Welcome() {
  return (
    <table className="index index-odd text-center">
      <tbody>
        <tr>
          <td>
            <div className="initial-intro hidden" id="intro-div">
              <img
                className="initial-pic"
                src={logo}
                alt="Banner for devonmartin.net"
              />
              <h2>Hey. I'm Devon.</h2>
              <h2>I'm a self-taught software engineer.</h2>
              <div>
                <a className="" href="#index-2">
                  Who?
                </a>
              </div>
            </div>
          </td>
        </tr>
      </tbody>
    </table>
  );
}

window.onload = () => {
  $("initial-intro").toggleClass("hidden");
};

export default Welcome;
